class Card{

    front;
    back;

    constructer(front, back){
        this.front = front;
        this.back = back;
    }

    editFront(front){
        this.front = front;
    }

    editBack(back){
        this.back = back;
    }

    getFront(){
        return this.front;
    }

    getBack(){
        return this.back;
    }
}

//module.exports = Card;

export default Card;
